import React, { useState, useEffect } from 'react';
import PropTypes from 'prop-types';
import {
  AppBar,
  Toolbar,
  Container,
  Typography,
  Button,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Box,
  CssBaseline,
  CircularProgress,
  FormControlLabel,
  Checkbox,
  Table,
  TableBody,
  TableCell,
  TableRow,
  TableContainer,
  Paper as MuiPaper,
  Dialog,
  IconButton,
  GlobalStyles
} from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';

function CustomCloseIcon(props) {
  return (
    <svg
      {...props}
      viewBox="0 0 24 24"
      width="24"
      height="24"
      fill="currentColor"
      aria-label="Close dialog"
      style={{ transition: 'transform 0.3s' }}
      onMouseEnter={(e) => (e.currentTarget.style.transform = 'rotate(90deg)')}
      onMouseLeave={(e) => (e.currentTarget.style.transform = 'rotate(0deg)')}
    >
      <path d="M19,6.41L17.59,5L12,10.59L6.41,5L5,6.41L10.59,12L5,17.59L6.41,19L12,13.41L17.59,19L19,17.59L13.41,12Z" />
    </svg>
  );
}

CustomCloseIcon.propTypes = {
  style: PropTypes.object
};

function RenderMetrics({ metrics }) {
  // ... Keep the existing RenderMetrics implementation unchanged ... 
  // (No changes needed here as we're only removing the plot from display)
}

RenderMetrics.propTypes = {
  metrics: PropTypes.object.isRequired
};

function App() {
  const [file, setFile] = useState(null);
  const [algorithm, setAlgorithm] = useState('');
  const [prediction, setPrediction] = useState('');
  const [metrics, setMetrics] = useState(null);
  const [loading, setLoading] = useState(false);
  const [analyzing, setAnalyzing] = useState(false);
  const [problemType, setProblemType] = useState(null);
  const [availableAlgorithms, setAvailableAlgorithms] = useState([]);
  const [analyzed, setAnalyzed] = useState(false);
  const [showMetrics, setShowMetrics] = useState(false);
  const [showOverviewPreview, setShowOverviewPreview] = useState(false);

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
    setAnalyzed(false);
    setProblemType(null);
    setAlgorithm('');
    setPrediction('');
    setMetrics(null);
    setAvailableAlgorithms([]);
  };

  const handleSubmit = async () => {
    if (!file || !algorithm) {
      alert('Please select a file and an algorithm!');
      return;
    }
    const formData = new FormData();
    formData.append('file', file);
    formData.append('algorithm', algorithm);
    formData.append('show_metrics', showMetrics ? 'true' : 'false');
    try {
      setLoading(true);
      const trainRes = await fetch('http://localhost:5000/train', {
        method: 'POST',
        body: formData,
      });
      if (!trainRes.ok) {
        const error = await trainRes.json();
        throw new Error(error.error || 'Training failed');
      }
      const trainResult = await trainRes.json();
      if (trainResult.error) throw new Error(trainResult.error);

      const queryPred = Array.isArray(trainResult.query_prediction)
        ? trainResult.query_prediction[0]
        : trainResult.query_prediction;
      setPrediction(queryPred);

      // Remove plot-related data from metrics
      let metricsCopy = trainResult.metrics ? { ...trainResult.metrics } : null;
      if (metricsCopy) {
        delete metricsCopy.plot;
        delete metricsCopy.plot_width;
        delete metricsCopy.plot_height;
      }
      setMetrics(metricsCopy);
    } catch (err) {
      alert('Error: ' + err.message);
    } finally {
      setLoading(false);
    }
  };

  // ... Keep the rest of the component unchanged until the return statement ...

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <GlobalStyles
        styles={{
          '@keyframes fadeIn': {
            '0%': { opacity: 0 },
            '100%': { opacity: 1 }
          },
          '@keyframes slideDown': {
            '0%': { transform: 'translateY(-20px)', opacity: 0 },
            '100%': { transform: 'translateY(0)', opacity: 1 }
          },
          '@keyframes scaleUp': {
            '0%': { transform: 'scale(0.8)' },
            '100%': { transform: 'scale(1)' }
          },
          '@keyframes pulse': {
            '0%': { transform: 'scale(1)' },
            '50%': { transform: 'scale(1.02)' },
            '100%': { transform: 'scale(1)' }
          }
        }}
      />

      {/* Keep the AppBar and Dialog components unchanged */}

      <Container maxWidth="lg" sx={{ py: 4, animation: 'fadeIn 1s ease-out' }}>
        <Box sx={{ display: 'flex', flexDirection: { xs: 'column', md: 'row' }, gap: 4 }}>
          {/* Left Panel - Keep unchanged */}

          {/* Right Panel */}
          <Box
            sx={{
              flex: 1,
              background: 'linear-gradient(135deg, #7f39fb, #9c27b0)',
              p: 4,
              borderRadius: 2,
              minHeight: '500px',
              display: 'flex',
              flexDirection: 'column',
              justifyContent: 'flex-start',
              transition: 'transform 0.5s',
              '&:hover': { transform: 'scale(1.02)' },
              animation: 'slideDown 0.6s ease-out'
            }}
          >
            <Typography
              variant="h5"
              sx={{
                textAlign: 'center',
                fontWeight: 'bold',
                color: '#fff',
                mb: 3
              }}
            >
              Results
            </Typography>
            {prediction && (
              <Box
                sx={{
                  backgroundColor: 'rgba(255,255,255,0.85)',
                  borderRadius: 2,
                  p: 2,
                  mb: 3,
                  boxShadow: '0 0 10px rgba(0,0,0,0.1)',
                  textAlign: 'center',
                  animation: 'fadeIn 0.8s ease-out'
                }}
              >
                <Typography
                  variant="h6"
                  sx={{
                    color: '#6a1b9a',
                    fontWeight: 'bold'
                  }}
                >
                  Prediction: {prediction}
                </Typography>
              </Box>
            )}
            {showMetrics && metrics && (
              <Box
                sx={{
                  backgroundColor: 'rgba(255,255,255,0.85)',
                  borderRadius: 2,
                  p: 2,
                  boxShadow: '0 0 10px rgba(0,0,0,0.1)',
                  flex: '1 1 auto',
                  animation: 'fadeIn 0.8s ease-out'
                }}
              >
                <RenderMetrics metrics={metrics} />
              </Box>
            )}
          </Box>
        </Box>
      </Container>
    </ThemeProvider>
  );
}

export default App;
